// React: 框架核心
// ReactDOM: 专门做渲染相关的包

import React from 'react';
import ReactDOM from 'react-dom/client';

//应用的全局样式文件
import './index.css';

// 引入根组件
import App from './App';

const root = ReactDOM.createRoot(document.getElementById('root'));

// 渲染根组件APP 到一个id为root的dom节点上
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);

